import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // The page's JavaScript will render product cards. We will interact with them.
    // Step 1: Rapidly add multiple items to the cart.
    // We use getByRole to find all "Add to Cart" buttons, which is a robust, user-facing selector.
    const addToCartButtons = await page.getByRole('button', { name: 'Add to Cart' }).all();

    if (addToCartButtons.length < 3) {
      throw new Error('Could not find enough "Add to Cart" buttons to perform the test.');
    }

    // Click the first three buttons in quick succession without waiting for each click to fully resolve.
    await Promise.all([
      addToCartButtons[0].click(),
      addToCartButtons[1].click(),
      addToCartButtons[2].click(),
    ]);

    await page.waitForTimeout(500); // Short pause to allow cart count to update.

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_items_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_items_added.png'));

    // Step 2: Open the cart to view the items.
    // Using a CSS selector for the div containing the cart text.
    await page.locator('div.cart').click();
    await page.waitForSelector('.cart-item', { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_opened.png'));

    // Step 3: Manipulate items in the cart.
    // Increase quantity of the first item.
    await page.getByRole('button', { name: '+' }).first().click();

    // Remove the second item.
    await page.getByRole('button', { name: 'Remove' }).nth(1).click();

    await page.waitForTimeout(500); // Short pause for UI to reflect changes.

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_manipulated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_manipulated.png'));

    // Step 4: Extract data to verify the test.
    const cartTotal = await page.locator('#cartTotal').textContent();
    const remainingItemsCount = await page.locator('.cart-item').count();

    return {
      success: true,
      action: "Performed a rapid cart manipulation stress test: added 3 items, increased quantity of one, and removed another.",
      extractedData: {
        finalCartTotal: cartTotal,
        remainingItemsInCart: remainingItemsCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    try {
      await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
      screenshots.push(path.join(screenshotsDir, 'error.png'));
    } catch (e) {
      // Ignore if screenshot fails
    }
    return {
      success: false,
      action: "Failed to complete rapid cart manipulation stress test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
